import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { LoginComponent } from './login/login.component';
import { RegisterComponent } from './register/register.component';
import { HomeComponent } from './home/home.component';
import { MemberViewComponent } from './member/member-view/member-view.component';
import { AdminViewComponent } from './admin/admin-view/admin-view.component';

const routes: Routes = [
  { path: "", component: HomeComponent },
  {
    path : "login", component : LoginComponent
  },
  {
    path : "register", component : RegisterComponent
  },
  {
    path: "memberView", component: MemberViewComponent
  },
  {
    path: "admin", component: AdminViewComponent
  },
  {
    path: "showMember", component: AdminViewComponent
  }, {
    path: "showTrainer", component: AdminViewComponent
  }, {
    path: "showMaterial", component: AdminViewComponent
  }, {
    path: "", component: AdminViewComponent
  },
];

@NgModule({
  imports: [RouterModule.forRoot(routes)],
  exports: [RouterModule]
})
export class AppRoutingModule { }
